sect1.para:
Create an Annotation object of the desired subclass (for example TextAnnotation) and set its properties: Poppler::TextAnnotation*myann=newPoppler::TextAnnotation(Poppler::TextAnnotation::InPlace);
myann->setBoundary(QRectF(0.1,0.1,0.2,0.2));//normalizedcoordinates:(0,0)istop-left,(1,1)isbottom-right
myann->setContents("Hello,world!");

Always set a boundary rectangle, or nothing will be shown!
Obtain a pointer to the Page where you want to add the annotation (refer to req for instructions) and add the annotation: Poppler::Page*mypage=...;
mypage->addAnnotation(myann);
